import React, { Component } from 'react';
import { View, Image, StyleSheet, Text } from "react-native";
import './App.css';

const maintitle = require('./images/main-title.svg');

class App extends Component {
    render() {
        return (
            
            <div className="App">
                <View>
                    <Image
                        style={styles.maintitle}
                        source={maintitle}
                        />
                </View>
            </div>
        );
    }
}

export default App;
